DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `vcrud_history`(
	IN activity VARCHAR(10),
    IN id VARCHAR(15),
    IN history_id VARCHAR(7),
    IN history VARCHAR(1408))
BEGIN
		IF activity="CREATE" THEN
			INSERT INTO history
				VALUES(history_id,id,history,now());
