		ELSEIF activity="DELETE" THEN
			DELETE FROM history
				WHERE history.`History_id`=history_id;
		ELSEIF activity="VIEW" THEN		
			SELECT * FROM history
				WHERE history.`History_id`=history_id;
		ELSEIF activity="VIEW_BY_ID" THEN		
			SELECT * FROM history
				WHERE history.`patient_id`=id;
		END IF;
	END */$$
