/* Procedure structure for procedure `view_logs` */

/*!50003 DROP PROCEDURE IF EXISTS  `view_logs` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `view_logs`()
BEGIN
	SELECT CONCAT(log_id,">"),comments FROM _clinic.`logs`
		ORDER BY lid DESC
		LIMIT 500;
		
	END */$$
